import { line, curveNatural } from "d3";

const Marks = ({ data }) =>
  data.map((d) => (
    <g className="marks">
      <path
        fill="none"
        stroke="black"
        d={line()
          .x((d) => xScale(xValue(d)))
          .y((d) => yScale(yValue(d)))
          .curve(curveNatural)(data)}
      />
      {
        // <circle
